private void evictEntry(K key) {
  CacheEntry<K,V> o = map.remove(key);
  if (o == null) return;
  stats.size.decrementAndGet();
  stats.evictionCounter++;
  if(evictionListener != null) evictionListener.evictedEntry(o.key,o.value);
}

